import React from "react";
import "../styles/default-container.css";
import "../styles/header.css";

export default function DefaultContainer() {
  return (
    <div id="divHeader" runat="server" class="header">
            <div class="logoSection">
                <div class="logoContainer">
                    <img id="logoImg" src={require("../images/SiteHawk_Logo.png")} className="logoImg" alt="logo" />
                </div>
            </div>
            <div class="otherSection">
            </div>
            <div class="facilityUserContainer">
            <div class="facilityContextContainer hidden-xs" data-toggle="modal" data-target="#facilityContextModal">
                <i class="fa fa-sitemap fa-lg" aria-hidden="true"></i>&nbsp;
            </div>
            </div>
            <div class="quickSearchInput quickSearchHeaderInput hidden-xs hidden-sm">
            </div>

        </div>
  );
}
